import React from 'react';

export default function Header() {
    return (
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <div class="container-fluid">
                <a class="navbar-brand" href="#">David Changa</a>
            </div>
        </nav>
    );
}
